import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Popover from '@material-ui/core/Popover';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import AccountCircleOutlinedIcon from "@material-ui/icons/AccountCircleOutlined";
import Divider from '@material-ui/core/Divider';


const useStyles = makeStyles(theme => ({
  typography: {
    padding: theme.spacing(2),
  },
}));

export default function SimplePopover() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = event => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const open = Boolean(anchorEl);
  const id = open ? 'simple-popover' : undefined;

  return (
    <div>
         <AccountCircleOutlinedIcon onClick={handleClick} />

      <Popover  style={{top:'5%'}}
        id={id}
        open={open}
        anchorEl={anchorEl}
        onClose={handleClose}
        anchorOrigin={{
          vertical: 'bottom',
          horizontal: 'right',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'right',
        }}
      >
        <Typography className={classes.typography}> 


           <div className="mainprofle">
           <div > <AccountCircleOutlinedIcon onClick={handleClick} /></div>
           <div>pandit walde</div>
           <div>panditwalde64@gmail.com</div>
           <div>Manage your  Fundoo Account</div>
           <Divider />
           <div><Button
              variant="contained"
              color="white"
           >sign out</Button></div>
           <Divider />
           <div> Privacy Policy    <li/>  Terms of Service</div>
           </div>
        </Typography>
      </Popover>
    </div>
  );
}
